import styles from "./Main.module.css"
import SideBar from "./SideBar/SideBar";
import MainContent from "./MainContent/MainContent.module.css";


function Main(){
    return(
        <div className={styles.wrapper}>
            <SideBar/>
            <MainContent/>
        </div>
    )
}
export default Main
